import React, { Component } from "react";
import categoryButton from "./categoryButton";
import Categories from "../assets/categories.jpg";

class Second extends Component {
  state = {
    categories: [
      (value = "category1"),
      (value = "category2"),
      (value = "category3"),
      (value = "category4"),
      (value = "category5"),
      (value = "category6"),
      (value = "category7"),
    ],
  };

  render() {
    return (
      // <Wrapper>
      <React.Fragment>
        <div
          style={{
            backgroundImage: "url(" + Categories + ")",
            paddingTop: 50,
            padding: 50,
            paddingBottom: 50,
            backgroundPosition: "center",
            backgroundSize: "cover",
            backgroundRepeat: "no-repeat",
            width: "100vw",
            height: "100vh",
          }}
          className="jumbotron jumbotron-fluid"
          className="text-right p-5"
        >
          <div className="container">
            <h2
              className="display-4"
              className="text-center text-white pr-5 pt-5 mt-5"
            >
              Lets find you a photographer
            </h2>
            <p
              className="lead medium"
              className="text-center text-white pr-5 mt-1"
            >
              Choose the categories you wish to browse <br />
            </p>
            <ul>
              {this.state.categories.map((Category) => (
                <categoryButton value={Category.value} />
              ))}
            </ul>
          </div>
        </div>
      </React.Fragment>
      // </Wrapper>
    );
  }
}

export default Second;
